load_differentially_expressed_genes:
  type: parse
  inputs: {}
  properties:
    locationSource: LOCAL
    localLocationConfiguration:
      path: ../../data
      normalizeGDrive: true
    recurse: true
    filter: .*deseq.alc.vs.control.age.rin.batch.gender.PMI.corrected.w.prot.coding.gene.name.xlsx
