      includeSheetName: false
      includeSheetIndex: false
      includeSheetRow: false
      includeSheetColumn: false
      includeSegmentIndex: false
    separatedValueConfigurations:
    - locationPattern: .*
      svConfiguration:
        delimiter: ','
        characterSet: UTF-8
    excelConfigurations:
    - locationPattern: .*
      excelConfiguration:
        mergeBehaviour: HIDDEN
    fcsConfigurations:
    - locationPattern: .*
      fcsConfiguration:
        log10: false
    pdfConfigurations:
    - locationPattern: .*
      pdfConfiguration:
        flavor: LATTICE
        pages: 1-end
        splitText: false
